import { useEffect, useState } from 'react';

import './App.css';

function App() {
  const [todos, setTodos] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3003/todos')
      .then((data) => data.json())
      .then((todos) => {
        setTodos(todos);
      })
      .catch((error) => console.log(error));
  }, []);

  console.log(todos);

  return (
    <main className="main">
      <h1>Your toDos</h1>
      <form className='form'>
        <input type="text" placeholder='Enter your task'/>
        <button>Add</button>
      </form>
      <div>
        {todos.map((todo) => (<>
          <h3>{todo}</h3>
        </>))}
      </div>

    </main>
  );
}

export default App;
